import React from 'react';
import style from './App.module.css';
//import Cards from './components/Cards/Cards'

import {Cards, Chart,CountryPicker} from './components'
import {fatchData} from './api';

function App() {
  return (
    <div className={style.container}>
     <h1>App</h1>

      <Cards/>
      <Chart/>
      <CountryPicker/>
    </div>
  );
}

export default App;
